static void test_ft_memset_one(size_t len, int c, int *current, int total) {
	
	*current += 1;
	unsigned char *mem;
	mem = (char *)malloc(len);
	ft_memset(mem, c, len);
	for (size_t i = 0; i<len; i++) {
		if (mem[i] != (unsigned char)c) {
			printf("FT_MEMSET failed at [%d][%zu]: %u != %u\n", *current, i, mem[i], (unsigned char)c);
			fflush(stdout);
		}
		assert(mem[i] == (unsigned char)c);
	}
	free(mem);
	STATUS(*current, total);
}


#ifdef SPEEDTEST
static void test_ft_memset_speed()
{
	char	*mem;

	CATEGORY("ft_memset performance");

	size_t len = 10485760;
	size_t iter = 1000;

	clock_t start = 0;
	mem = (char *)malloc(sizeof(char) * len);
	for (int i = 0; i < iter + 25; i++) {
		if (i == 24)
			start = clock();
		memset(mem, 0, len);
	}
	clock_t end = clock();
	double ft_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / ft_time, "memset");

	for (int i = 0; i < iter + 10; i++) {
		if (i == 9)
			start = clock();
		memset(mem, 0, len);
	}
	end = clock();
	double new_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / new_time, "ft_memset");
	SPEEDCMP((ft_time / new_time) * 100, "memset");
	free(mem);
}
#endif // SPEEDTEST

