/*
** ft_memccpy *******************************************************************
*/

static void test_ft_memccpy_one(void *src0, int c, size_t len, int *current, int total) {
	
	*current += 1;
	unsigned char *dst;
	unsigned char *dst_ret;
	unsigned char *memchr_ret;
	unsigned char *src = src0;

	dst = (char *)malloc(len);
	dst_ret = (unsigned char *)ft_memccpy(dst, src, c, len);
	memchr_ret = memchr(src0, c, len);
	if ((memchr_ret == NULL && dst_ret != NULL) \
		|| (memchr_ret != NULL && dst_ret == NULL)) {
		printf("FT_MEMCCPY failed at return value is incorrect\n");
		assert(0);
	}
	if (dst_ret != NULL && *(dst_ret - 1) != c) {
		printf("FT_MEMCCPY failed at return value is incorrect. c == %c and dst_ret - 1 == %c\n", c, *(dst_ret - 1));
		assert(0);
	}
	for (size_t i = 0; i<len; i++) {
		if (dst_ret && dst + i >= dst_ret)
			break ;
		if (src[i] != dst[i]) {
			printf("FT_MEMCCPY failed at [%d][%zu]: %u != %u\n", *current, i, dst[i], src[i]);
			fflush(stdout);
		}
		assert(src[i] == dst[i]);
	}
	free(dst);
	STATUS(*current, total);
}


#ifdef SPEEDTEST
static void test_ft_memccpy_speed()
{
	char	*src;
	char	*dst;

	CATEGORY("ft_memccpy performance");

	size_t len = 1048576;
	size_t iter = 1000;

	clock_t start = 0;
	src = (char *)malloc(sizeof(char) * len);
	dst = (char *)malloc(sizeof(char) * len);
	src[1048570] = 'X';
	for (int i = 0; i < iter + 25; i++) {
		if (i == 24)
			start = clock();
		memccpy(dst, src, 'X', len);
	}
	clock_t end = clock();
	double ft_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / ft_time, "memccpy");

	ft_bzero(dst, len);
	for (int i = 0; i < iter + 10; i++) {
		if (i == 9)
			start = clock();
		ft_memccpy(dst, src, 'X', len);
	}
	end = clock();
	double new_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / new_time, "ft_memccpy");
	SPEEDCMP((ft_time / new_time) * 100, "memccpy");
	free(src);
	free(dst);
}
#endif // SPEEDTEST

